        description: ""

    },
    {
        name:"Solon Springs Educational Foundation",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/SSEF-teaser.jpg",
        linkpath: "/project-page/ssef",
        description: ""
    },
    {
        name:"Mountain Bike Travel",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/MTNbiketravel-teaser.jpg",
        linkpath: "/project-page/mtn-bike-travel",
        description: ""
    },
    {
        name: "Our Saviour's Lutheran Church",
        type: "Graphic Design",
        role: "Branding & Identity Design",
        imgpath: "/images/teasers/oslc-teaser.jpg",
        linkpath: "/project-page/oslc",
        description: ""
    },
    {
        name:"Hoppy Trails: bikable brewery crawls",
        type:"Graphic Design",
        role:"Branding & Identity Design",
        imgpath: "/images/teasers/hoppytrails-teaser.jpg",
        linkpath: "/project-page/hoppy-trails",
        description: ""
    },
    {
        name:"Comfort Food Valentine Cards",
        type:"Illustration",
        role:"Illustration",
        imgpath: "/images/teasers/valentines-teaser.jpg",
        linkpath: "/project-page/valentines",
        descriptionParaOne: "Ah, Valentine's Day â€” a celebration of extroverted love and commercialism, when despite your cynical nature you find your self wandering through aisle after aisle of greeting cards and chocolate trying to find your feelings reflected in a canned Hallmark card.",
        descriptionParaTwo: "This series of Valentines was created to appeal to the humor of lovers who lunch (and dinner, and dessert). Because in the arena of love, when has ice cream ever let you down?",
        descriptionParaThree: "The bright color scheme conveys cheer and excitement. Puns and wit collide merrily with adorable illustrations to create anthropomorphic comfort food that will make even your grumpiest friend or lover smile. Go ahead, eat your heart out."
    },
    {
        name:"Indexical Vegetables Poster",
        type:"Illustration",
        role:"Illustration",
        imgpath: "/images/teasers/veggieposter-teaser.jpg",
        linkpath: "/project-page/indexical-veggies",
        description: ""
    },
    {
        name:"Geometric Typeface",
        type:"Graphic Design",
        role:"Typographer",
        imgpath: "/images/teasers/alphabet-teaser.jpg",
        linkpath: "/project-page/typeface-design",
        description: ""
    },
    {
        name:"Blueberry Summer",
        type:"Guoache & Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/blueberry-teaser.jpg",
        linkpath: "/project-page/blueberry-summer",
        description: ""
    },
    {
        name:"Fish & Chives",
        type:"Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/vasestilllife-teaser.jpg",
        linkpath: "/project-page/fish-chives",
        description: ""
    },
    {
        name:"Plant Party",
        type:"Watercolor Painting",
        role:"Painting",
        imgpath: "/images/teasers/stilllife-teaser.jpg",
        linkpath: "/project-page/plant-party",
        description: ""
    }
];


function Portfolio() {
    return(
        <main>
            <section className="filtering">
            </section>

            <section className="gallery">
                {projects.map(project => {
                    return (
                        <ProjectPreview
                            name={project.name}
                            type={project.type}
                            role={project.role}
                            imgpath={project.imgpath}
                            linkpath={project.linkpath}

                        />
                    )
                })}
            </section>
        </main>
    )
}



export default Portfolio;
